import React from "react";
import ReactDOM from "react-dom";
import App from "./App"
import { BrowserRouter as Router } from "react-router-dom";

ReactDOM.render(( <
    Router history = { browserHistory } >
    <
    Route path = "/"
    component = { App } >
    <
    IndexRoute component = { Home }
    /> <
    Route path = "home"
    component = { Home }
    /> <
    Route path = "about"
    component = { About }
    /> <
    Route path = "contact"
    component = { Contact }
    /> <
    /Route> <
    /Router>
), document.getElementById('app'))
